"use strict";

function f_gold(s, k) {
    let counter = new Array(26).fill(0);
    let i = 0, j = 0, maxCnt = 0;
    while (i < s.length) {
        counter[s.charCodeAt(i) - 'A'.charCodeAt(0)] += 1;
        maxCnt = Math.max(maxCnt, counter[s.charCodeAt(i) - 'A'.charCodeAt(0)]);
        if (i - j + 1 > maxCnt + k) {
            counter[s.charCodeAt(j) - 'A'.charCodeAt(0)] -= 1;
            j += 1;
        }
        i += 1;
    }
    return i - j;
}
